import React from 'react';
import Navbar from './Navbar'; // Import your Navbar component
import './HomePage.css'; // Add your CSS styling here

function HomePage() {
  return (
    React.createElement('div', { className: 'home-container' },
      React.createElement(Navbar, null), // Include the Navbar component
      React.createElement('header', { className: 'lord-of-the-rings-header' },
        React.createElement('h1', null, 'Welcome to Middle-earth Productivity'),
        React.createElement('p', null, 'One Ring to rule them all, and in your productivity, bind them!')
      ),
      React.createElement('div', { className: 'content' },
        React.createElement('h2', null, 'Your Journey Begins Here'),
        React.createElement('p', null, 'This is the home page content. Embark on a productive adventure!')
      )
    )
  );
}

export default HomePage;
